import React, { useState, useEffect } from "react";
import axios from "../services/api";
import { Bar } from "react-chartjs-2";

const FrequencyReport = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios
      .get("/reports/frequency")
      .then((response) => setData(response.data))
      .catch((error) =>
        console.error("Error fetching frequency report:", error),
      );
  }, []);

  const chartData = {
    labels: data.map((item) => item.method),
    datasets: [
      {
        label: "Communication Count",
        data: data.map((item) => item.count),
        backgroundColor: "rgba(75,192,192,0.4)",
        borderColor: "rgba(75,192,192,1)",
        borderWidth: 1,
      },
    ],
  };

  return (
    <div className="frequency-report">
      <h1>Communication Frequency Report</h1>
      <Bar data={chartData} />
    </div>
  );
};

export default FrequencyReport;
